Horror / Thriller
93 minuten

goed

met Asia Argento, Dennis Hopper en Simon Baker

De levende doden hebben de de Aarde definitief in hun greep gekregen en de laatste overlevende mensen hebben zich in een 
versterkte stad teruggetrokken. Hun enige verweer tegen de ondoden is een enorme tank, de Dead Reckoning, die in het bezit is van 
de steenrijke Kaufman. De rest van de bevolking heeft het helaas wat minder goed en moet dagelijks keihard vechten om de ondoden 
buiten de stadsmuren te houden.
